import React from "react";
import { MathTopics } from "../../../data/MathTopics";
import { CardComponent } from "../../../UI";

export const CalculusScreen: React.FC = () => {
  console.log(MathTopics[0].subtopics);
  return (
    <>
      <h1 className="subject-screen-header">Calculus</h1>
      <div>
        {MathTopics[0].subtopics.map((subtopic) => {
          <CardComponent
            key={subtopic}
            title={subtopic}
            path={subtopic.toLowerCase()}
            color="red"
          >
            <p>hello from {subtopic}</p>
          </CardComponent>;
        })}
      </div>
    </>
  );
};
